import React from "react";

function Roster({ detailed, roster }) {
  let rows;
  if (!detailed){
    rows = roster.map(({ id, firstName }) => {
        <ol>
          <li>{id}</li>
          <li>{firstName}</li>
        </ol>
    });
    return 
  <main>{rows}</main>
  } else {
    rows = roster.map(({ id, firstName, lastName, location }) => {
      <div>
      <table>
        <thead>
          <tr>
            <th>ID</th>
            <th>First Name</th>
            <th>Last Name</th>
            <th>Location</th>
          </tr>
        </thead>
        <tbody>
          <tr>
            <td>{id}</td>
            <td>{firstName}</td>
            <td>{lastName}</td>
            <td>{location}</td>
          </tr>
        </tbody>
      </table>
      </div>
    });
    return (
      <main>
        {rows}
      </main>
    )
  }

}

export default Roster;
